import { Route, Routes } from 'react-router-dom';

const Welcome = () => {
  return (
    <>
      <h1>Welcome Page</h1>
      <Routes>
        <Route path='/welcome/new-user' element={<p>Welcome New User!</p>} />
      </Routes>
    </>
  );
};

export default Welcome;
